import React from 'react'
import { FormControlLabel, ListItemButton, ListItemIcon} from '@mui/material';
import { CheckBox } from '@material-ui/icons';

import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles({
  root: {
    '&$checked': {
      color: '#fff',
    },
  },
  checked: {},
  wrap: {
    width: '100%',
    display: 'flex',
    flexDirection: 'row-reverse',
    justifyContent: 'space-between',
    alignItems: 'center',
    marginLeft: 0,
  },
  label: {
    fontSize: '.8rem',
    fontFamily: `'Raleway', sans-serif`,
  },
});


const CheckedboxProton = ({changeChecked,age}) => {
    const classes=useStyles()
    const {checked,label,id}=age;
  return (
    <div>
        <ListItemButton sx={{ pl: 4 }} alignItems="flex-start">
       
      
      <FormControlLabel
       classes={{
      label:classes.label,
       root:classes.wrap
      }}
      control={
      <CheckBox classes={{
      checked: classes.checked,
      root:classes.root
      }} 
      size='small'
            checked={checked}
            onChange={() => changeChecked(id)}
            inputProps={{ 'aria-label': 'checkbox with small size'}}
 />
}
label={label}
/>
</ListItemButton>


</div>
    
  )
}

export default CheckedboxProton
